'toolkit/chrome/global/aboutRights.dtd:rights.webservices-term4' => 'ଏହି ସର୍ଭିସଗୁଡ଼ିକ &#34;  &amp;vendorShortName;ପରି &#34;ପ୍ରଦାନ କରିଥାଏ,ଏହାର ସହଯୋଗୀ, ପ୍ରମାଣପତ୍ର ଦାତା, ବଣ୍ଟନକାରୀମାନେ ସମସ୍ତ ନିର୍ଭରୋକ୍ତିକୁ ଅସ୍ୱୀକାର କରିଥାନ୍ତି, ଅଭିବ୍ୟକ୍ତ କରାଯାଇଥିଲେ ଅଥବା ପ୍ରୟୋଗ କରାଯାଇଥିଲେ, ସମସ୍ତ ବାରଣ, ନିର୍ଭରୋକ୍ତିକୁ ଅନ୍ତର୍ଭୁକ୍ତ କରି, ଯାହାକି ସେହି ସର୍ଭିସଗୁଡ଼ିକୁ ବାଣିଜ୍ୟ ଉପଯୋଗୀ କରିଥାଏ ଏବଂ ଆପଣଙ୍କର ନିର୍ଦ୍ଦିଷ୍ଟ ଉଦ୍ଦେଶ୍ୟ ପାଇଁ ଉପଯୁକ୍ତ ହୋଇଥାଏ। ଆପଣ ଏହାର ସମଗ୍ର ବିପଦକୁ ଧାରଣ କରିବେ ଯେପରିକି ଆପଣଙ୍କ ଉଦ୍ଦେଶ୍ୟ ପାଇଁ ସର୍ଭିସ ଏବଂ ଗୁଣ ଏବଂ କାର୍ଯ୍ୟକ୍ଷମତା ଚୟନ କରିବେ। କିଛି କ୍ଷେତ୍ରରେ ଏହି ନିର୍ଭେରୋକ୍ତି ଏବଂ ବାରଣକୁ ତ୍ୟାଗ କରିଥାଏ, ଯାହାଫଳରେ ଏହା ଆପଣଙ୍କ ପାଇଁ ପ୍ରୟୋଗ ହୋଇନଥାଏ।',
'toolkit/chrome/global/aboutRights.dtd:rights.webservices-term5' => 'ନିୟମରେ ଆବଶ୍ୟକତା ବ୍ୟତୀତ, &amp;vendorShortName;, ଏହାର ସହଯୋଗୀ, ଅନୁମତି ଧାରଣକର୍ତ୍ତା, ଏବଂ ବଣ୍ଟନକାରୀମାନେ କୋଣସି ଅପ୍ରତ୍ୟକ୍ଷ,ବିଶେଷ, ଘଟଣାକ୍ରମିକ, ଫଳସ୍ୱରୂପ, ଦଣ୍ଡାତ୍ମକ, କିମ୍ବା ଘଟିତ କୌଣସି ଅନୁକରଣୀୟ କ୍ଷତି କିମ୍ବା ଯେକୌଣସି ଉପାୟରେ &amp;brandShortName;ର ବ୍ୟବହାର  ଏବଂ ତାହାର ସର୍ଭିସ ସହିତ ସମ୍ପୃକ୍ତ।  ଏହି ନିତୀ ଅନ୍ତର୍ଗତରେ ସମୁଦାୟ କ୍ଷତି $500 (ପାଞ୍ଚ ଶହ ଡଲର)କୁ ଅତିକ୍ରମ କରୁନଥିବ। କିଛି କ୍ଷେତ୍ରରେ ଏହାକୁ ଅଥବା କିଛି ନିର୍ଦ୍ଦିଷ୍ଟ କ୍ଷତିକୁ ମାନ୍ୟତା ଦେଇନଥାଏ, ତେଣୁ ଏହି ବହିର୍ଗତ ଏବଂ ସୀମା ଆପଣଙ୍କ କ୍ଷେତରେ ଲାଗୁ ହୋଇନପାରେ।',
